import React from "react";

import Timeline from "../Timeline";

function Experience() {
  return (
    <section className="section" id="experience">
      <div className="container">
        <h1 className="title">Experience</h1>
        <Timeline />
      </div>
    </section>
  );
}

export default Experience;
